import React, {Component} from 'react'
import { Navbar, Button, Nav, NavDropdown } from 'react-bootstrap';
import PropTypes from 'prop-types'
import { withRouter } from "react-router-dom"
import {connect} from 'react-redux'
import {logout} from '../../actions/loginActions'

class LoginNav extends Component {
    constructor(props){
        super(props)
        this.profile = this.profile.bind(this)
    }
    static propTypes = {
        atuh: PropTypes.object.isRequired,
        logout: PropTypes.func.isRequired
    }

    // const user = localStorage.getItem('authUser')
    // const history = useHistory();

    // function refreshPage() {
    //     window.location.reload(false);
    // }

    logout = (e) => {
        e.preventDefault()
        this.props.logout()
        // localStorage.setItem('authUser', '');
        // refreshPage();
    }

    handleClick = () => {
        this.props.history.push("/profile");
    }

    render() {
        return (
        <>
        <Navbar>
            <Navbar.Brand href="/home" style={{color: "black"}} className="col-md-9 col-sm-6">
            <img
                alt=""
                src="../logo192.png"
                width="30"
                height="30"
                className="d-inline-block align-top"
            />{' '}
            Splitwise
            {' '}
            </Navbar.Brand>
            <Nav className="justify-content-end" activeKey="/home">
                <Nav.Item>
                <Nav.Link href="/dashboard">Dashboard</Nav.Link>
                </Nav.Item>
                <NavDropdown title={this.props.name} id="nav-dropdown">
                    <NavDropdown.Item eventKey="4.1" onClick={this.handleClick}>Profile</NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item eventKey="4.4" onClick={this.handleClick}>Logout</NavDropdown.Item>
                </NavDropdown>
            </Nav>
        </Navbar>
        </>
        )
    }
}

const mapStateToProps = (state) => {
    console.log("state", state);
  return {
    auth: state.auth
  }
}

export default connect()(LoginNav)
